import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a product card to open the modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // Wait for the modal to be visible
    const modalLocator = page.locator('xpath=//div[contains(@class, "modal") and contains(@style, "display: block")]');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    const modalVisibleBefore = await modalLocator.isVisible();

    // Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden
    await modalLocator.waitFor({ state: 'hidden', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    const modalVisibleAfter = await modalLocator.isVisible();

    return {
      success: true,
      action: "Closed a modal by pressing the Escape key.",
      extractedData: {
        modalVisibleBefore: modalVisibleBefore,
        modalVisibleAfter: modalVisibleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
